import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
    return ( < div className = "App" > < script color = "255, 255, 255"
        count = "100"
        opacity = "0.7"
        src = "https://cdn.bootcss.com/canvas-nest.js/1.0.1/canvas-nest.min.js"
        type = "text/javascript"
        zindex = "-2" > < /script> < /div > );
}
export default App;
